import { useState } from "react";


function Card() {

    let [nutrients, setNutrients] = useState(['Omega-3', 'multivitimin', 'test', 'test', 'Omega-3', 'multivitimin', 'test', 'test', 'Omega-3', 'multivitimin', 'test', 'test'])

    return (
        <>
            <div className="flex flex-wrap -m-4 px-5 py-10 mx-auto">
                <div className="p-4 md:w-1/3 max-md:p-1">
                    <div className="border-dotted border-4 hover:scale-101 rounded-lg h-full p-6 shadow-lg hover:shadow-indigo-500/30 cursor-pointer">
                        <button className='relative inset-1/2 -translate-y-1/2 -translate-x-1/2 text-white bg-indigo-500 px-2 rounded-full text-lg'>+</button>
                    </div>
                </div>
                <AddForm />
                {
                    nutrients.map((data, i) => {
                        return (
                            <div className="p-4 md:w-1/3 max-md:p-1">
                                <div className=" hover:scale-101 rounded-lg bg-gray-100 p-6 shadow-lg hover:shadow-indigo-500/30 cursor-pointer">
                                    <div className="flex mb-3">
                                        <h2 className="text-gray-900 text-base font-medium max-md:text-sm">{data}</h2>
                                        <p className=" text-indigo-500 ml-2 text-sm max-md:text-xs">시간</p>
                                    </div>
                                    <div className=" text-gray-600">
                                        <p className="text-sm max-md:hidden">Blue bottle crucifix vinyl post-ironic four dollar toast vegan taxidermy. Gastropub indxgo juice poutine.</p>
                                    </div>
                                </div>
                            </div>
                        )
                    })
                }
            </div>


        </>
    )
}

function AddForm(props) {
    return (
        <div className="absolute w-full h-full background-gray-100">

        </div>
    )
}



export default Card;
